import React, {
  Fragment,
  useRef,
  useState,
  useEffect
} from "react";
import {
  motion,
  useScroll,
  useSpring,
  useTransform,
  motionValue,
  useMotionValue
} from "framer-motion"

/* Images */
import img_test from '../../imgs/components/logo_school.png';

/* Styles */
import './notFound.scss'

/* Testing Paralax Efect with react Framer Motion */
function useParallax(value, distance) {
  return useTransform(value, [0, 0.1], [-distance, distance]);
}

function Image({ id }) {
  const ref = useRef(null);
  const { scrollYProgress } = useScroll({ target: ref });
  const y = useParallax(scrollYProgress, 300);

  return (
    <section className="paralax">
      <div ref={ref}>
        <img src={img_test} alt="" />
      </div>
      <motion.h2 style={{ y }}>{`#00${id}`}</motion.h2>
    </section>
  );
}

export function NotFoundPage() {
  /* Testing useState Hook */
  const [count, setcount] = useState(0);

  function aumentarNum() {
    setcount(count + 1);
  };

  return (
    <Fragment>
      <div className="notFound">
        <div className="header-sep"></div>
        <>
          {[1, 2, 3, 4, 5].map((image) => (
            <Image id={image} />
          ))}
        </>
        <section className="nf_c01">
        <button onClick={aumentarNum}>Click Me</button>
        </section>
        <section className="nf_c02">Tu le has dado click al boton {count} veces</section>
        <section className="component1">asd</section>
        <section className="component1">asd</section>
      </div>
    </Fragment>
  );
}
